import { useState } from "react"


const Contador2 = () => {

    const [contador, setContador] = useState({

        contador: 1,
        fyh: new Date()

    });

    const incrementar = () => {
            setContador({
                contador: contador.contador + 1,
                fyh: new Date()
            })
    }

  return (

    <div className="container my-5" >
        <h2>Counter</h2>
        <hr />
        <button className="btn btn-primary" onClick={incrementar} >CLICK ACA BRO</button>
        <hr />
        <h4>{contador.contador}</h4>
        <p>fecha y hora de ultimo click: {new Date().toLocaleTimeString()}</p>
    </div>
  )
}
export default Contador2
